          <div className="item-1">
           <a href='#'><img className="img-1" src="assets/youtube.png" alt=""/></a>
          </div>
          <div className="item-1">
           <a href='#'><img className="img-1" src="assets/linkedin.png" alt=""/></a>
          </div>
          <div className="item-1">
           <a href='#'><img className="img-1" src="assets/twitter.png" alt=""/></a>
          </div>
         </div> 
        </div>
      </div>
	)
}

export default Red;
